import logo from './bryandelossantos.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          
          My name is Bryan De Los Santos and I'm going to master React!
        </p>
        <a
          className="App-link"
          href="https://github.com/ATEOTG"
          target="_blank"
          rel="noopener noreferrer"
        >
          Check Me Out!
        </a>
      </header>
    </div>
  );
}

export default App;
